import React from 'react'
import '../../public/assets/style.scss';
import Menu from './menu';


function Navbar() {



    return (
        <div className="">
            <nav className="navbar">
                <div className="two-column-row">
                    <div className="column"> <img src="/images/ubelogo.jpeg" alt="logo" height="100px" width="300px"/></div>

                    <div id="profilePic" className="column"><img src="/images/profilepic.png" alt="profilepic"/></div>
                </div>
            </nav>
        </div>
    )

}

export default Navbar
